import React from 'react'

export const TodoItem = () => {
  var rows = []
  let items = [
    {
      sno: 1,
      title: "Go to Market",
      desc: "Job 1"
    },
    {
      sno: 2,
      title: "Go to Mall",
      desc: "Job 2"
    },
    {
      sno: 3,
      title: "Go to Ghat",
      desc: "Job 3"
    }
  ]

  return (
    <div>
      rows.push(items.map(items) =>
        <h2> {items.title} </h2>
        <p> {items.desc} </p>
      )
    </div>

  )
}
